import React, { useState, useEffect } from 'react';
import axios from 'axios';
import authHeader from './services/auth-header';

function AllOrders() {
    const [users, setUsers] = useState([]);
    const [selectedUser, setSelectedUser] = useState(null);
    const [orders, setOrders] = useState([]);
    const [totalPrice, setTotalPrice] = useState(0);

    useEffect(() => {
        fetchAllUsers();
    }, []);

    const fetchAllUsers = async () => {
        try {
            const response = await axios.get('http://localhost:8080/orderDetails/users', {
                headers: authHeader(),
            });
            setUsers(response.data);
        } catch (error) {
            console.error('Error fetching users:', error);
        }
    };

    const fetchOrdersByUser = async (userId) => {
        try {
            const response = await axios.get(`http://localhost:8080/orderDetails/details/user/${userId}`, {
                headers: authHeader(),
            });
            setOrders(response.data);

            const total = response.data.reduce((acc, orderDetail) => acc + (orderDetail.quantity * orderDetail.product.price), 0);
            setTotalPrice(total);
        } catch (error) {
            console.error('Error fetching user orders:', error);
        }
    };

    const handleUserClick = (user) => {
        setSelectedUser(user);
        setOrders([]);
        setTotalPrice(0);
        
        fetchOrdersByUser(user.id);
    };

    
    return (
      <div>
          <h2>Popis korisnika</h2>
          <table className="user-table">
              <thead>
                  <tr>
                      <th>Korisnik</th>
                  </tr>
              </thead>
              <tbody>
                  {users.map((user) => (
                      <tr key={user.id}>
                          <td><a href="#" onClick={() => handleUserClick(user)}>{user.username}</a></td>
                      </tr>
                  ))}
              </tbody>
          </table>
          
          {selectedUser && (
              <div>
                  <h3>Narudžbe korisnika {selectedUser.username}</h3>
                  <table className="order-table">
                      <thead>
                          <tr>
                              <th>Slika</th>
                              <th>Proizvod</th>
                              <th>Količina</th>
                              <th>Cijena</th>
                              <th>Datum narudžbe</th>
                          </tr>
                      </thead>
                      <tbody>
                          {orders.length > 0 ? (
                              orders.map((orderDetail) => (
                                  <tr key={orderDetail.id}>
                                      <td><img src={`http://localhost:8080/products/images/${orderDetail.product.imageURL}`} alt={orderDetail.product.name} width="100" /></td>
                                      <td>{orderDetail.product.name}</td>
                                      <td>{orderDetail.quantity}</td>
                                      <td>{orderDetail.product.price}</td>
                                      <td>{orderDetail.order.order_time}</td>
                                  </tr>
                              ))
                          ) : (
                              <tr>
                                  <td colSpan="5">Nema još narudžbi.</td>
                              </tr>
                          )}
                      </tbody>
                  </table>
                  <div className="total-price">
                      <h4>Ukupna cijena narudžbe: {totalPrice}</h4>
                  </div>
              </div>
          )}
      </div>
  );
}


export default AllOrders;
